import axios from "axios";

const Page = ({ stars }) => <div>Next stars: {stars}</div>;

Page.getInitialProps = async ({ query }) => {
  const userAgent = req ? req.headers["user-agent"] : navigator.userAgent;
  return { userAgent: userAgent };
};

export default Page;
